import React from "react";
import "./index.css";
import BitcoinChart from "./components/BitcoinChart";

function App() {
  return (
    <div>
      <header>
        <h1>Stock Trading Demo</h1>
        <h2>Bitcoin Price Chart</h2>
      </header>
      <main>
        <BitcoinChart />
      </main>
    </div>
  );
}

export default App;
